struct Resource
{
	uint8_t* mData;
	int mCompressedSize;
	int mFileSize;
	int mOffset;

	Resource():mData(NULL),mCompressedSize(0),mFileSize(0),mOffset(0){}
	
	~Resource()
	{
		delete []mData;
	}

	bool Compress(const char* pSource,int &pTotalCompressedSize)
	{
		if( mFileSize > 0 )
		{
			int posibleSize = LZ4_compressBound(mFileSize);
			uint8_t* CompressedFile = new uint8_t[posibleSize];
			mCompressedSize = LZ4_compress_default(pSource,(char*)CompressedFile,mFileSize,posibleSize);
			if( mCompressedSize > 0 )
			{
				mData = CompressedFile; // CompressedFile may have more ram but that is fine as mCompressedSize is correct and what is used.
				pTotalCompressedSize += mCompressedSize;
			}
		}
		return mCompressedSize > 0;
	}
};

class Resources : public std::map<std::string,Resource*>
{
public:
	~Resources()
	{
		for(auto r : (*this) )
			delete r.second;
	}

	Resource* Add(const std::string& pFilename)	// Returns NULL if file has already been added.
	{
		Resource* newResource = NULL;
		if( find(pFilename) == end() )
		{
			newResource = new Resource();
			(*this)[pFilename] = newResource;
		}
		return newResource;
	}
};

BuildTaskResourceFiles::BuildTaskResourceFiles(const std::string& pTaskName, const ResourceFiles& pResourceFiles,const std::string& pOutputPath,bool pVerboseOutput): BuildTask(pTaskName,pVerboseOutput),
	mOutputPath(CleanPath(pOutputPath + "/resources/")),
	mIncludeLZ4Code(pResourceFiles.GetIncludeLZ4Code())
{
	for( auto& rf : pResourceFiles )
		mResourceFiles.push_back(rf.first);
	
}

BuildTaskResourceFiles::~BuildTaskResourceFiles()
{
}

bool BuildTaskResourceFiles::GetGeneratedResourceFiles(SourceFiles& rGeneratedResourceFiles)
{
	if( mGeneratedResourceFiles.size() > 0 )
	{
		for( const auto& file : mGeneratedResourceFiles )
			rGeneratedResourceFiles.AddFile(file,"resources");
		return true;
	}
	return false;
}

bool BuildTaskResourceFiles::Main()
{
	// Write the header.
	WriteSupportingCodeFile(table_of_contents[3],true);
	// Lets make sure the lz4 files are there.
	if( mIncludeLZ4Code )
	{
		WriteSupportingCodeFile(table_of_contents[0],false);
		WriteSupportingCodeFile(table_of_contents[1],false);
	}
	
	if(mVerboseOutput)
		std::cout << "Checking to see if resources need to be rebuilt." << std::endl;

	const std::string ResourceOutputFilename = CleanPath(mOutputPath + "/resources.cpp");
	mGeneratedResourceFiles.push_back(ResourceOutputFilename);
	if(ResourceFileIsUpToDate(ResourceOutputFilename))
	{
		// Get here we're all upto date and so does not need rebuilding.	
		if(mVerboseOutput)
			std::cout << "resources.cpp is upto date, no need to rebuild resources." << std::endl;
		return true;// All good.
	}
	else if(mVerboseOutput)
	{
		std::cout << "resources.cpp not found or is out of date, rebuilding." << std::endl;
	}


	if(mVerboseOutput)
		std::cout << "Gathering resource files and compressing..." << std::endl;
	
	int numFiles = 0;
	int uncompressedSize = 0;
	int compressedSize = 0;

	Resources files;

	for( const auto& filename : mResourceFiles )
	{
		numFiles++;

		Resource* file = files.Add(filename);
		if( file )
		{
			std::ifstream InputFile(filename,std::ifstream::binary);
			if( InputFile )
			{
				InputFile.seekg (0, InputFile.end);
				file->mFileSize = InputFile.tellg();
				InputFile.seekg (0, InputFile.beg);

				if( file->mFileSize > 0 )
				{
					uncompressedSize += file->mFileSize;

					char* FileData = mSourceBuffer.data(file->mFileSize);
					assert(FileData);
					if(FileData)
					{
						InputFile.read(FileData,file->mFileSize);
						if( InputFile )
						{
							if( file->Compress(FileData,compressedSize) )
							{
								if(mVerboseOutput)
									std::cout << "  " << filename << " " << file->mFileSize << " -> " << file->mCompressedSize << std::endl;
							}
							else
							{
								mResults = "Failed: Could not compress file \'";
								mResults += filename;
								mResults += "\'";
								return false;
							}						
						}
						else
						{
							mResults = "Failed: Could read all the data for file \'";
							mResults += filename;
							mResults += "\'";
							return false;
						}
					}
					else
					{
						mResults = "Failed: Could not allocate memory for file \'";
						mResults += filename;
						mResults += "\'";
						return false;
					}
				}
				else
				{
					mResults = "Failed: file \'";
					mResults += filename;
					mResults += "\' is zero length in size!";
					return false;
				}
			}
			else
			{
				mResults = "Failed: Could not open file \'";
				mResults += filename;
				mResults += "\'";
				return false;
			}
		}
		else
		{
			if(mVerboseOutput)
				std::cout << "  " << filename << " already been added, skipping." << std::endl;
		}
	}

	if(mVerboseOutput)
	{
		std::cout << numFiles << "  files compressed from " << uncompressedSize << " to " << compressedSize << std::endl;
		std::cout << "Generating cpp files for resources"  << std::endl;
	}

	// Build the final block of data, creating the offsets for the TOC.
	// Reuse the CompressBuffer.
	uint8_t* CompressData = new uint8_t[compressedSize];
	int offset = 0;
	for( auto& f : files )
	{
		f.second->mOffset = offset;
		memcpy(CompressData + offset,f.second->mData,f.second->mCompressedSize);
		offset += f.second->mCompressedSize;
	}
	assert( offset == compressedSize );

	if( offset == compressedSize )
	{
		// Better make sure output folders are there.
		MakeDir(mOutputPath);

		// Read the source file in so we can then insert our compressed data block.
		int SizeToWrite;
		char* beforeCodeBlock = DecompressSupportingCodeFile(table_of_contents[2],SizeToWrite);
		if( beforeCodeBlock == NULL )
		{
			std::cout << "Internal error, unable to decompress supporting code. This is an internal bug. Please report too hamandeggs.github.io/appbuild/"  << std::endl;
			return false;
		}

		const char* SEARCH_STRING = "//*****-APPBUILD-INSERT-RESOURCE-HERE-*****";
		const char* afterCodeBlock = strstr(beforeCodeBlock,SEARCH_STRING);
		assert(afterCodeBlock);
		if(!afterCodeBlock)
		{
			std::cout << "Internal error, unable to find hook in source code to insert compressed data. This is an internal bug. Please report too hamandeggs.github.io/appbuild/"  << std::endl;
			return false;
		}
		beforeCodeBlock[afterCodeBlock-beforeCodeBlock] = 0;
		afterCodeBlock += strlen(SEARCH_STRING);

		std::ofstream cpp(ResourceOutputFilename,std::ofstream::trunc);
		if( cpp.is_open() )
		{
			// Write the first part of the source file
			cpp << beforeCodeBlock << std::endl << std::endl;

			// Write out the table of contents.
			cpp << "static const ResourceFilesTOC table_of_contents[] =" << std::endl;
			cpp << "{" << std::endl;
			bool first = true;
			for( const auto& f : files )
			{
				if( !first )
				{
					cpp << "," << std::endl;
				}
				first = false;
				cpp << "  {\"" << f.first << "\","<< f.second->mOffset << "," << f.second->mCompressedSize << "," << f.second->mFileSize << "}";
			}
			cpp << std::endl << "};" << std::endl << std::endl;

			// Now write out the data.
			int LineLength = 0xfffff;
			cpp << "static const uint8_t resource_file_data[] =" << std::endl;
			cpp << "{" << std::endl;
			for( int n = 0 ; n < compressedSize ; n++ )
			{
				if( LineLength >= 2000 )
				{
					cpp << std::endl << "  ";
					LineLength=2;// for the two spaces.
				}
				cpp << (int)CompressData[n];// Want the numeric value so have to cast to an int.
				if( n < compressedSize-1 )// Don't do comma for last one.
				{
					cpp << ",";
					LineLength++; //For the comma.
				}
				LineLength += (CompressData[n]<10?1:(CompressData[n]<100?2:3));			
			}
			cpp << std::endl << "};" << std::endl << std::endl;

			// Now write the rest of the source.
			cpp << afterCodeBlock << std::endl;

			// Cleanup ram.
			delete []CompressData;
			delete []beforeCodeBlock;
		}
		else
		{
			std::cout << "Failed to open resource file \'" << ResourceOutputFilename << "\' for output"  << std::endl;
			return false;
		}
	}
	else
	{
		std::cout << "Failed to generate resource files, disagrement in compressed size and written size to buffer. This is an internal bug. Please report too hamandeggs.github.io/appbuild/"  << std::endl;
		return false;
	}

	return true;
}

void BuildTaskResourceFiles::WriteSupportingCodeFile(const ResourceFilesTOC& pFile,bool pWriteToProjectFileLocation)
{
	const std::string fname = pWriteToProjectFileLocation ? CleanPath(pFile.mFilename) : CleanPath(mOutputPath + pFile.mFilename);
	if( GetExtension(fname) != ".h" )
		mGeneratedResourceFiles.push_back(fname);
	
	if( FileExists(fname) )
	{
		if(mVerboseOutput)
			std::cout << "Resource file " << fname << " already exists, not generating." << std::endl;
	}
	else
	{
		if(mVerboseOutput)
			std::cout << "Writing Resource file " << fname << std::endl;
		
		// Not found, write it.
		std::ofstream lz4(fname,std::ofstream::trunc);
		if( lz4.is_open() )
		{
			int SizeToWrite;
			const char* dest = DecompressSupportingCodeFile(pFile,SizeToWrite);
			if( dest )
			{
				lz4.write(dest,SizeToWrite);
				delete []dest;
			}
		}			
	}
}

char* BuildTaskResourceFiles::DecompressSupportingCodeFile(const ResourceFilesTOC& pFile,int &pSizeToWrite)const
{
	char* dest = new char[pFile.mFileSize+1];
	pSizeToWrite = LZ4_decompress_safe((const char*)(resource_file_data + pFile.mOffset),dest,pFile.mCompressedSize,pFile.mFileSize);
	if( pSizeToWrite < 0  )
	{
		return NULL;
	}

	dest[pFile.mFileSize] = 0;// Null terminate so we can treat it as a string.
	return dest;
}

bool BuildTaskResourceFiles::ResourceFileIsUpToDate(const std::string& pResourceOutputFilename)const
{
	struct stat ResourceFileStats;
	if( stat(pResourceOutputFilename.c_str(), &ResourceFileStats) == 0 && S_ISREG(ResourceFileStats.st_mode) )
	{
		const timespec& ResourceFileTime = ResourceFileStats.st_mtim;
		// Now compare against all the resource files.
		for( const auto& filename : mResourceFiles )
		{
			struct stat FileStats;
			if( stat(filename.c_str(), &FileStats) == 0 && S_ISREG(FileStats.st_mode) )
			{
				if(FileStats.st_mtim.tv_sec == ResourceFileTime.tv_sec)
				{
					if( FileStats.st_mtim.tv_nsec > ResourceFileTime.tv_nsec )
						return false; // Need rebuild
				}
				else if( FileStats.st_mtim.tv_sec > ResourceFileTime.tv_sec )
					return false; // Need rebuild
			}
			else
			{
				return false; // Can get stats for input resource file, tell code to rebuild. This will trigger the correct error to the user when it's not found.
			}
		}
		return true;
	}

	return false;// Can't get file stats, so force rebuild as prob not found.	
}

